/*Table structure for table `ed_file` */

DROP TABLE IF EXISTS `ed_file`;

CREATE TABLE `ed_file` (
  `id` int(11) NOT NULL auto_increment,
  `fname` varchar(1000) default NULL,
  `ed_time` varchar(1000) default NULL,
  `status` varchar(1000) default NULL,
  `des_time` varchar(1000) default NULL,
  `status2` varchar(1000) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=latin1;

/*Data for the table `ed_file` */

insert  into `ed_file`(`id`,`fname`,`ed_time`,`status`,`des_time`,`status2`) values (15,'sample.txt','1499200','encryption','1397200','decryption');

/*Table structure for table `owner` */

DROP TABLE IF EXISTS `owner`;

CREATE TABLE `owner` (
  `username` varchar(50) default NULL,
  `password` varchar(50) default NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `owner` */

insert  into `owner`(`username`,`password`) values ('owner','owner');

/*Table structure for table `ownerreg` */

DROP TABLE IF EXISTS `ownerreg`;

CREATE TABLE `ownerreg` (
  `id` int(11) NOT NULL auto_increment,
  `name` text,
  `pass` text,
  `email` text,
  `mobile` text,
  `addr` text,
  `dob` text,
  `gender` text,
  `pin` text,
  `location` text,
  `imagess` longblob,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

